import "./Game.css"
export let Game = function(){



    return(
        <div className="App">
            <div className="board">
                <div className="row">
                    <Square />
                    <Square />
                    <Square />
                </div>
                <div className="row"></div>
                <div className="row"></div>

            </div>
        </div>
        



    );

}

let Square = function({val, chooseSquare}){
    return (
        <div className="square" onClick={chooseSquare}>
            {val}
        </div>
    )
}
